syntax = "proto3";

import "H5ActivityInfo.proto";

message GetAllH5ActivityInfoRsp {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 5653;
	}

	int32 retcode = 1;
	repeated H5ActivityInfo h5_activity_info_list = 2;
	uint32 client_red_dot_timestamp = 3;
}
